import styled from 'styled-components'

export const Title = styled.h1`
  color: palevioletred;
  text-align: center;
  font-style: bold;
  font-size: 40pt;
  font-family: sans-serif;
`
export const Subtitle = styled.h1`
  font-style: italic;
  font-family: sans-serif;
  font-size: 20pt;
  text-align: center;
`


export const Page = styled.div`
  background-color: lightblue;
`
